import Sim1 from './sketch1'
import P5Wrapper from "./P5Wrapper";


class Simulations extends Component {
        state={

        };

    render() {
    return (
        <React.Fragment>
         <P5Wrapper
             sketch={Sim1}
             p5Props={{width1:100,height:100}}
         />
         <button className="btn btn-dark m-2">Start</button>
            <button className="btn btn-dark m-2">Reset</button>
        </React.Fragment>
    );
  }


}

export default Simulations;
